import React from "react";
import "./styles.css";

export default function App() {
  return (
    <div>
      <Button color="black" text="Hello" disabled={true} />
      <Button color="orange" text="Hello 2" disabled={false} />
      <Button color="blue" text="Hello 3" disabled={true} />
    </div>
  );
}

function Button({ color, isDisabled, text }) {
  return (
    <button style={{ backgroundColor: { color } }} disabled={isDisabled}>
      {text}
    </button>
  );
}
